$templateCache.put("libs/ammaps/plugins/responsive/examples/serial3.html","<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01//EN\" \"http://www.w3.org/TR/html4/strict.dtd\"><html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"><meta name=\"viewport\" content=\"width=device-width,initial-scale=1,maximum-scale=1\"><title>amCharts Responsive Example</title><script src=\"http://www.amcharts.com/lib/3/amcharts.js\"></script><script src=\"http://www.amcharts.com/lib/3/serial.js\"></script><script src=\"../responsive.min.js\"></script><style>body, html {\r\n    height: 100%;\r\n    padding: 0;\r\n    margin: 0;\r\n  }</style><script>var chartData = [];\r\n    generateChartData();\r\n\r\n    var chart = AmCharts.makeChart(\"chartdiv\", {\r\n      \"type\": \"serial\",\r\n      \"dataProvider\": chartData,\r\n      \"categoryField\": \"date\",\r\n      \"categoryAxis\": {\r\n        \"parseDates\": true,\r\n        \"gridAlpha\": 0.15,\r\n        \"minorGridEnabled\": true,\r\n        \"axisColor\": \"#DADADA\"\r\n      },\r\n      \"valueAxes\": [{\r\n        \"axisAlpha\": 0.2,\r\n        \"id\": \"v1\"\r\n      }],\r\n      \"graphs\": [{\r\n        \"title\": \"red line\",\r\n        \"id\": \"g1\",\r\n        \"valueAxis\": \"v1\",\r\n        \"valueField\": \"visits\",\r\n        \"bullet\": \"round\",\r\n        \"bulletBorderColor\": \"#FFFFFF\",\r\n        \"bulletBorderAlpha\": 1,\r\n        \"lineThickness\": 2,\r\n        \"lineColor\": \"#b5030d\",\r\n        \"negativeLineColor\": \"#0352b5\",\r\n        \"balloonText\": \"[[category]]<br><b><span style=\'font-size:14px;\'>value: [[value]]</span></b>\"\r\n      }],\r\n      \"chartCursor\": {\r\n        \"fullWidth\": true,\r\n        \"cursorAlpha\": 0.1\r\n      },\r\n      \"chartScrollbar\": {\r\n        \"scrollbarHeight\": 40,\r\n        \"color\": \"#FFFFFF\",\r\n        \"autoGridCount\": true,\r\n        \"graph\": \"g1\"\r\n      },\r\n      \"mouseWheelZoomEnabled\": true,\r\n      \"responsive\": {\r\n        \"enabled\": true\r\n      }\r\n    });\r\n\r\n    chart.addListener(\"dataUpdated\", zoomChart);\r\n\r\n\r\n    // generate some random data, quite different range\r\n    function generateChartData() {\r\n      var firstDate = new Date();\r\n      firstDate.setDate(firstDate.getDate() - 500);\r\n\r\n      for (var i = 0; i < 500; i++) {\r\n        // we create date objects here. In your data, you can have date strings\r\n        // and then set format of your dates using chart.dataDateFormat property,\r\n        // however when possible, use date objects, as this will speed up chart rendering.\r\n        var newDate = new Date(firstDate);\r\n        newDate.setDate(newDate.getDate() + i);\r\n\r\n        var visits = Math.round(Math.random() * 40) - 20;\r\n\r\n        chartData.push({\r\n            date: newDate,\r\n            visits: visits\r\n        });\r\n      }\r\n    }\r\n\r\n    // this method is called when chart is first inited as we listen for \"dataUpdated\" event\r\n    function zoomChart() {\r\n      // different zoom methods can be used - zoomToIndexes, zoomToDates, zoomToCategoryValues\r\n      chart.zoomToIndexes(chartData.length - 40, chartData.length - 1);\r\n    }</script></head><body><div id=\"chartdiv\" style=\"width: 100%; height: 100%\"></div></body></html>");
